css:
@-moz-document domain("www.thesixtyone.com") {
body {
    background-color: #28211C;
    color: #BAAE9E;
}

.song_player tr.main td, .song_player tr.drawer_close td {
	border-color: #6F5D5D;
}

table.song_player {
    color: #BAAE9E;                                         
}

.subnavigation a.selected {
	color: #FA0;
}

table.search_results_tab tr td {
	background-color: #484848;
    border: 0;
}

table.search_results_tab tr td a,
table.search_results_tab tr td div {
	color: #AAA;
}

table.search_results_tab tr td.selected a {
	color: #FA0;
}

table.search_results_tab tr td.selected {
    background-color: transparent;
}

#page_content input[type="text"], #page_content input[type="password"],
textarea#comments_post,
textarea {
    background-color: #333;
    border-color: #555;
    color: #BAAE9E;
}

#list_topics tr:hover,
.no-touchevents .subnavigation a.subnav_button:hover, .subnavigation a.subnav_button:active {
	background-color: rgba(0,0,0,0.25);
}

.no-touchevents table.search_results_tab tr td a:active, table.search_results_tab tr td a:hover {
	color: #DDD;
}

table.results_list tr, table[className="results_list"] tr td {
    background-color: #333;
}

.no-touchevents table.results_list tr:hover, .no-touchevents table[className="results_list"] tr:hover td {
    background-color: #444;
}

table.results_list,
table.results_list tr td,
#edit_account form,
#list_posts tr td,
#new_topic_wrapper, #list_posts_wrapper,
.group_panel,
.above_subnavigation,
.below_subnavigation,
.subnavigation a.subnav_button {
	border-color: rgba(0,0,0,0.25);
}

.song_player tr.main td,
.song_player tr.drawer_close td {
	border-color: rgba(0,0,0,0.25);
}

.no-touchevents a.dark:hover, a.dark:active {
	color: #BAAE9E;
}

a.dark:link, a.dark:visited,
.song_player .title a,
a:link, a:visited {
	color: #AC8854;
}

.song_player .caption a {
	color: #AC8854;
}

.song_player .actions a, .song_player .status .edit_tags a {
	color: #AC8854;
}

.no-touchevents table.song_player:hover {
	background-color: #533;
}

.no-touchevents table.search_results_tab tr td:hover {
	background-color: #333;
}

.pagination div {
    background: transparent;
}

.pagination .currentpage {
	background: rgba(0,0,0,0.25);
}

.no-touchevents .pagination a:hover, .pagination a:active {
	background: transparent;
}

.pagination .disablepage,
.pagination a {
	border: 0;
}

.comments td.spacer_cell {
    border-color: rgba(0,0,0,0.25);
}

.song_player tr.selected td {
    border-color: #FA0;
}


